import { Text, View, Image, TouchableOpacity} from 'react-native';
import { Styles } from './src/styles'

export default function App() {
  return (
    <View style={Styles.container}>

      <Image
        style={Styles.logo}
        source={require("./src/assets/logo-ip4y.fw.png")}
      />

      <Text style={Styles.title}>Sejá bem vindo!
        <Text style={Styles.subTitle}>fdsadfas</Text>

      </Text>

      <TouchableOpacity 
        style={Styles.bottonForm}

      >
        <Text style={Styles.textBottonForm}>Formulário do Cliente</Text>
      </TouchableOpacity>

    </View>
  );
}
